import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Step 1: Add an item to the cart programmatically
    await page.evaluate(() => {
      // @ts-ignore
      addToCart(1); // Add "Apple iPhone 15 Pro Max"
    });

    // Step 2: Open the cart modal to view the item
    await page.evaluate(() => {
      // @ts-ignore
      showCart();
    });

    // Wait for the cart modal and item to be visible
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_with_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_with_item.png'));

    // Step 3: Extract the initial quantity
    const initialQuantityLocator = page.locator('.cart-item-quantity .quantity');
    const initialQuantity = await initialQuantityLocator.textContent();

    // Step 4: Click the '+' button to increase the quantity
    const incrementButton = page.locator('.cart-item-quantity .quantity-btn').nth(1);
    await incrementButton.click();

    // Wait for the quantity to update. Playwright's auto-waiting will handle this.
    await page.waitForFunction(
      (expected) => document.querySelector('.cart-item-quantity .quantity')?.textContent === expected,
      '2',
      { timeout: 5000 }
    );

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // Step 5: Extract the updated quantity
    const updatedQuantity = await initialQuantityLocator.textContent();

    return {
      success: true,
      action: "Updated cart item quantity from 1 to 2.",
      extractedData: {
        initialQuantity: initialQuantity,
        updatedQuantity: updatedQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
